import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';

export default function HealthCalculatorScreen({route, navigation}) {
  return (
    <View style={styles.container}>
      <View style={{width : '100%', 
                    padding : 10, 
                    }}>
        <Text>Course Name {!courseNameValidate ? <Text style={{color:'red'}}>*required</Text> : ""}</Text>
        {/* Course name input */}
        <TextInput
          style={styles.coursenameinput}
          onChangeText={setCourseName}
          value={courseName}
        />
      </View><Text>Posture {postureValidate ? "" : <Text style={{color:'red'}}>*required</Text>}</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
